import { Row, Col, Container } from "react-bootstrap";
import projImg1 from '../assets/img/project-img1.png';
import projImg2 from '../assets/img/project-img2.png';
import projImg3 from '../assets/img/project-img3.png';
import Nav from 'react-bootstrap/Nav';

export const Projects = () => {

    const projects = [
        {
            title: "Project 1",
            description: "Project 1 Despription",
            imgUrl: projImg1,
        },
        {
            title: "Project 2",
            description: "Project 2 Despription",
            imgUrl: projImg2,
        },
        {
            title: "Project 3",
            description: "Project 3 Despription",
            imgUrl: projImg3,
        },
    ]
    return (
        <section className="project" id="project">
            <Container>
                <Row>
                    <Col>
                        <h2>Projects</h2>
                        <p>
                            Most of my projects aim to use the most modern and cutting edge technologies to enable a seamless user experience
                        </p>
                        <Nav variant="tabs" defaultActiveKey="/home">
                            <Nav.Item>
                                <Nav.Link eventKey="first">Tab One</Nav.Link>
                            </Nav.Item>
                            <Nav.Item>
                                <Nav.Link eventKey="second">Tab Two 2</Nav.Link>
                            </Nav.Item>
                            <Nav.Item>
                                <Nav.Link eventKey="third">Tab Three</Nav.Link>
                            </Nav.Item>
                        </Nav>
                    </Col>
                </Row>
            </Container>
        </section>
    )
}
